  definition: protrude from
  see_also: '{DuQ:v:1}, {bet:v}'
  notes: The object is the thing from which the subject protrudes.
  examples: '

    ▶ {chor jeq taj:sen:nolink} "a knife protrudes from a belly"[2]

    ▶ {tajwIj ''oHbe'' chorlIj jeqbogh Dochvetlh''e''.:sen:nolink} "That is not my
    dagger protruding from your midsection."[3]'
